import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  border: 1px solid #fff;
  border-radius: 20px;
  color: #fff;
  width: 200px & i {
    width: 40px;
    height: 40px;
  }
`;

export default function NavBarItem(props) {
  return (
    <Div>
      <i class="fa-bed" style={{ width: "30px", height: "30px" }}></i>
      <p>{props.type}</p>
    </Div>
  );
}
